import React, { useState, useEffect } from 'react';

const HistoryTable = () => {
  const [historyData, setHistoryData] = useState([]);

  useEffect(() => {
    const fetchHistoryData = async () => {
      try {
        // Replace 'https://jsonplaceholder.typicode.com/todos' with your actual API endpoint
        const response = await fetch('https://jsonplaceholder.typicode.com/todos');
        if (!response.ok) {
          throw new Error(`HTTP error! Status: ${response.status}`);
        }
        const data = await response.json();
        setHistoryData(data);
      } catch (error) {
        console.error("Error fetching history data:", error);
      }
    };

    fetchHistoryData();
  }, []);

  return (
    <div className="bg-blue-800 h-screen items-center justify-center p-4">
      <h2 className="text-2xl font-bold mb-4">History</h2>
      <div className="overflow-x-auto">
        <table className="w-full">
          <thead>
            <tr className="text-left">
              <th className="pb-4">Provider Name</th>
              <th className="pb-4">OFFER</th>
              <th className="pb-4">PURCHASED ON</th>
            </tr>
          </thead>
          <tbody>
            {historyData.map((item, index) => (
              <tr key={index}>
                <td className="py-2">{item.id}</td>
                <td className="py-2">{item.userId}</td>
                <td className="py-2">{item.title}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default HistoryTable;
